import React from "react";
import { FaLinkedin, FaGithub, FaFileCsv } from "react-icons/fa";
function Footer() {
  return (
    <div className="flex flex-row mb-5">
      <div>
        <a
          href="https://www.linkedin.com/in/zakaria-rab/"
          target="_blank"
          rel="noreferrer"
          className="text-3xl"
        >
          <FaLinkedin />
        </a>
      </div>
    </div>
  );
}

export default Footer;
